import {useState} from "react";


const useTags =() => {
    const [tags, setTags] = useState<string[]>(['餐饮','房租','服装','娱乐','旅行','美容','汽车','饮品','宠物','购物','度假','医疗']);
    const iconMap:{[k:string]:string} ={
        '餐饮':'餐饮',
        '房租':'房租',
        '服装':'服装',
        '娱乐':'娱乐',
        '旅行':'旅行',
        '美容':'美容',
        '汽车':'汽车',
        '饮品':'饮品',
        '宠物':'宠物',
        '购物':'购物',
        '度假':'度假',
        '医疗':'医疗'};
    return{tags}
}
export {useTags};
